import React from 'react';
import { useNavigate } from 'react-router-dom'; // Used for navigation after logout
import { useAuth } from '../context/AuthContext';

const Dashboard = () => {
  const { user, logout } = useAuth(); // Get the logout function from context
  const navigate = useNavigate();

  const handleLogout = () => {
    logout(); // Call the logout function to clear user data
    navigate('/login'); // Redirect to login page
  };

  return (
    <div>
      <h1>Dashboard</h1>
      {user ? (
        <>
          <p>Welcome, {user.coor_fname} {user.coor_lname}!</p>
          <button onClick={handleLogout}>Log Out</button>
        </>
      ) : (
        <p>Loading user data...</p>
      )}
    </div>
  );
};

export default Dashboard;
